const table7Content = document.getElementById("table7-content");
const table7Buttons = document.querySelectorAll("button[class=tbl7]");

const createRow3 = (obj) => {
  const row = document.createElement("tr");
  const objKeys = Object.keys(obj);
  objKeys.map((key) => {
    const cell = document.createElement("td");
    cell.setAttribute("data-attr", key);
    cell.innerHTML = obj[key];
    row.appendChild(cell);
  });
  return row;
};

const getTable7Content = (data) => {
  data.map((obj) => {
    const row = createRow(obj);
    table7Content.appendChild(row);
  });
};

const sortData3 = (data, param, direction = "asc") => {
  table7Content.innerHTML = "";
  const sortedData2 =
    direction == "asc"
      ? [...data].sort(function (a, b) {
          if (a[param] < b[param]) {
            return -1;
          }
          if (a[param] > b[param]) {
            return 1;
          }
          return 0;
        })
      : [...data].sort(function (a, b) {
          if (b[param] < a[param]) {
            return -1;
          }
          if (b[param] > a[param]) {
            return 1;
          }
          return 0;
        });
  getTable7Content(sortedData2);
};

const resetButtons3 = (event) => {
  [...table7Buttons].map((button) => {
    if (button !== event.target) {
      button.removeAttribute("data-dir");
    }
  });
};

window.addEventListener("load", () => {
  getTable7Content(spyALLTable.SPYALL);

  [...table7Buttons].map((button) => {
    button.addEventListener("click", (e) => {
      if (e.target.getAttribute("data-dir") == "desc") {
        sortData3(spyALLTable.SPYALL, e.target.id, "desc");
        e.target.setAttribute("data-dir", "asc");
      } else {
        sortData3(spyALLTable.SPYALL, e.target.id, "asc");
        e.target.setAttribute("data-dir", "desc");
      }
    });
  });
});
